import Carousel from "../../components/Common/Carousel";

const SearchDetail = () => {

    return (
      <div>
        <Header/>
        <Carousel/>
        <IntroList title="newactivity" type="AC"/>
        <IntroList title="hotPlace" type="PC"/>
        <IntroList title="goodFood" type="PC"/>
      </div>
    );
  };

  export default SearchDetail;
